import React, { Component } from 'react'
import EachMerchant from './EachMerchant/EachMerchant'
import OrderHistory from '../OrderHistory/OrderHistory'
import { Route, Link, Redirect, Switch } from 'react-router-dom'
import IndivListing from '../IndivStore/IndivListing'
import ListingContainer from '../IndivStore/ListingContainer'

export default class TimeLine extends Component {
    constructor(props) {
        super()
        this.state = {
            timeLine: [],
            oldTimeLine: [],
            fetch: false
        }
    }
    componentDidMount() {
        fetch('/timeline')
            .then(res => res.json())
            .then(res => {
                // console.log(res);
                this.setState({
                    timeLine: res,
                    newTimeLine: res
                })
            })
    }

    // componentDidUpdate() {
    //     console.log(`please no`)
    //     if (this.state.newTimeLine !== this.state.timeLine) {
    //         console.log(`here?`)
    //         fetch('/timeline')
    //             .then(res => res.json())
    //             .then(res => {
    //                 // console.log(res);
    //                 this.setState({
    //                     timeLine: res
    //                 })
    //             })
    //     }
    // }

    testing = (timeleft, merchantID) => {
        if (timeleft.hours === 0 && timeleft.minutes === 0 && timeleft.seconds === 0) {
            console.log(`passed the first conditional`)
            //timeOut are the cards which timed out that we're filtering out from the current timeline
            let timeOut = this.state.timeLine.filter(card => {
                if (card.merchant_id === merchantID) {
                    return card
                }
            })
            console.log(timeOut, `this is timeOut`)
            if (timeOut.length > 0 && this.state.fetch === true) {
                this.setState({
                    fetch: !this.state.fetch
                })
                setTimeout(fetch('/timeline')
                    .then(res => res.json())
                    .then(res => {
                        console.log(res);
                        //we are setting the cards we have removed as the oldTimeLine state, refresh the timeLine state with the new fetched cards, and setting a newtimeline that represents the timeline without the spliced cards
                        this.setState({
                            timeLine: res,
                            oldTimeLine: timeOut, //(the removed/ timedout items)
                            newTimeLine: newTimeLine //(prev timeline minus removed items)
                        })
                    }), 10000)
                console.log(`in timeoutlength> 0`)
                let newTimeLine = this.state.timeLine
                console.log(newTimeLine, `before`)
                timeOut.forEach(card1 => newTimeLine.splice(newTimeLine.findIndex(card2 => card2.name === card1.name), 1))
                //we are splicing out from the current timeline the cards that have timedout
                console.log(newTimeLine, `after`)



            }

        }
    }

    // testing = (prop) => {
    //     let b = Math.floor(Math.random() * 30)
    //     console.log(b)
    //     if (b === 4) {
    //         fetch('/timeline')
    //             .then(res => res.json())
    //             .then(res => {
    //                 console.log(res)
    //                 this.setState({
    //                     timeLine: res,
    //                     fetch: !this.state.fetch
    //                 })
    //             })
    //     }
    // }


    render() {
        // let newArray = this.state.timeLine.map((item, index) => {
        //     const uploadTime = new Date(item.time)
        //     uploadTime.setMinutes(uploadTime.getMinutes() + item.time_limit_min)
        //     let difference = +uploadTime - +new Date();
        //     if (difference > 0) {
        //         return item
        //     }
        // })
        // let newerArray = newArray.filter((item) => {
        //     return item
        // })


        this.state.timeLine.sort(function (a, b) {
            const uploadTimeA = new Date(a.time)
            uploadTimeA.setMinutes(uploadTimeA.getMinutes() + a.time_limit_min)
            const uploadTimeB = new Date(b.time)
            uploadTimeB.setMinutes(uploadTimeB.getMinutes() + b.time_limit_min)
            return uploadTimeA - uploadTimeB
        })
        // console.log(this.state.timeLine, `before splice`)
        if (this.state.timeLine.length > 20) {
            this.state.timeLine.splice(19, this.state.timeLine.length - 20)
        }
        // console.log(this.state.timeLine, `After splice`)
        let merchantCard = this.state.timeLine.map((eachCard, index) => {
            const discount = (eachCard.unit_price - eachCard.price_floor) / eachCard.unit_price * 100
            let path = "/" + eachCard.merchant_id
            return <Link to={path}>

                <EachMerchant key={index} duration={eachCard.time_limit_min} listing={eachCard.listing_id} time={eachCard.time} merchant_Id={eachCard.merchant_id} unmount={this.merchantCardUnmountHandler} what={this.testing}>
                    <div>{index}{eachCard.name}</div>
                    <div>up to{discount}%</div>
                </EachMerchant>

            </Link>
        })

        const routeArray = this.state.timeLine.map((eachCard, index) => {
            let path = "/" + eachCard.merchant_id
            return <Route path={path} render={
                () => <ListingContainer merchant_id={eachCard.merchant_id} stripper={this.props.stripper} />
            } />
        })
        return (
            <div>
                <div className="navbar">
                    <div>Image here</div>
                    <Link className="login break" to="/Timeline">Timeline</Link>
                    <Link className="login break" to="/Orderhistory">Order history</Link>
                </div>
                <main>
                    <Switch>
                        {routeArray}
                        <Route path="/Orderhistory" render={
                            () => <OrderHistory />
                        } />
                        <Route path="/" render={
                            () => <div>{merchantCard}</div>
                        } />
                    </Switch>
                </main>
            </div >
        )
    }
}
